import React from 'react';
import { Link,useParams } from 'react-router-dom';
import { Box } from '@mui/material';
const Home = (props) => {
  const idFoodBranch = useParams();
  console.log(props.data.listFood)
  return (
    <Box>
      {
        <Link to={`/shop${idFoodBranch}`}></Link>
      }
    </Box>
    )
};

export default Home;
